import React, {useContext} from 'react'
import {ThemeContext} from './App'
function Paragrapth() {
    const theme =  useContext(ThemeContext)
    return (
        <div className={theme}>
            Welcome to my Paragrapth 
        </div>
    )
}

export default Paragrapth
